<!DOCTYPE html>
<html>
    <head>
        <title>object return</title>
    </head>
    <body>
        <script>
            function func_one()
            {
                return {"key1":"hello",
                        "key2":"welcome",
                        "key3":"React"

            }}
            let res=func_one()
            document.write(res.key1, res.key2, res.key3)
        </script>
    </body>
</html>
